protected function extractFromCommand(array $args, ?callable $filter = NULL)
{
	$result = $this->run(...$args);
	$output = $result->getOutput();

	if ($filter !== NULL) {
		$newArray = [];

		foreach ($output as $line) {
			$value = $filter($line);

			if ($value === FALSE) {
				continue;
			}

			$newArray[] = (string) $value;
		}

		$output = $newArray;
	}

	if (empty($output)) {
		return NULL;
	}

	return $output;
}

